import React from 'react'
import { connect } from 'react-redux'
import Banner from '../../img/banner.jpg';
import './Worker.css'

export const Worker = (props) => {
  return (
    <div className="worker">
        <div className="w-portada">
            <img src={Banner} alt='banner'/>
        </div>
        {/* <div>Perfil que va a tener una posicion relativa, va a ser un componente con la foto, oficios, descripcion y certificados</div> */}
        <div className="w-left">
            chau
        </div>

        <div className="w-right">
            hola
        </div>
    </div>
  )
}

const mapStateToProps = (state) => ({})

const mapDispatchToProps = {}

export default connect(mapStateToProps, mapDispatchToProps)(Worker)
